          Добавление накладной
        </div>
        <div class="row">
          <div class="col-12 col-sm-12 col-md-6 col-lg-4 col-xl-4 modalcol">
            <div class="inputblock">
              <div class="input_title">Номер накладной *</div>
              <div class="input">
                <input type="text" placeholder="SND230 160 - 12">
              </div>
            </div>
          </div>
          <div class="col-12 col-sm-12 col-md-6 col-lg-4 col-xl-4 modalcol">
