            </div>
          </div>
          <div class="col-12 col-sm-12 col-md-6 col-lg-4 col-xl-4 modalcol">
            <div class="inputblock">
              <div class="input_title">Товар</div>
              <div class="input">
                <select>
                  <option selected>Выберите товар</option>
                  <option>LUBO</option>
                  <option>Emmy поворотники</option>
